INSERT INTO `NOTICES` VALUES (1,'2019-07-10','安徽省第五届普通高等学校体育教师教学技能比赛于2019年9月20日至9月22日在安徽师范大学举行。经专家评审、现场公布参赛教师成绩、参赛老师现场签字确认等环节，已评选出甲组、乙组、丙组参赛教师的得分及获奖等次，现予以公示。 公示时间为：2019年10月15日至2019年10月17日（3个工作日）。公示期间，如有异议，请以书面形式向省教育厅体卫艺处实名反映，并提供佐证资料，以便联系核实。','已发布'),(2,'2019-08-20','安徽省第五届普通高等学校体育教师教学技能比赛于2019年9月20日至9月22日在安徽师范大学举行。经专家评审、现场公布参赛教师成绩、参赛老师现场签字确认等环节，已评选出甲组、乙组、丙组参赛教师的得分及获奖等次，现予以公示。 公示时间为：2019年10月15日至2019年10月17日（3个工作日）。公示期间，如有异议，请以书面形式向省教育厅体卫艺处实名反映，并提供佐证资料，以便联系核实。','已发布'),(4,'2019-10-01','安徽省第五届普通高等学校体育教师教学技能比赛于2019年9月20日至9月22日在安徽师范大学举行。经专家评审、现场公布参赛教师成绩、参赛老师现场签字确认等环节，已评选出甲组、乙组、丙组参赛教师的得分及获奖等次，现予以公示。 公示时间为：2019年10月15日至2019年10月17日（3个工作日）。公示期间，如有异议，请以书面形式向省教育厅体卫艺处实名反映，并提供佐证资料，以便联系核实。','已发布'),(5,'2019-10-01','安徽省第五届普通高等学校体育教师教学技能比赛于2019年9月20日至9月22日在安徽师范大学举行。经专家评审、现场公布参赛教师成绩、参赛老师现场签字确认等环节，已评选出甲组、乙组、丙组参赛教师的得分及获奖等次，现予以公示。 公示时间为：2019年10月15日至2019年10月17日（3个工作日）。公示期间，如有异议，请以书面形式向省教育厅体卫艺处实名反映，并提供佐证资料，以便联系核实。','已发布'),(6,'2019-10-01','安徽省第五届普通高等学校体育教师教学技能比赛于2019年9月20日至9月22日在安徽师范大学举行。经专家评审、现场公布参赛教师成绩、参赛老师现场签字确认等环节，已评选出甲组、乙组、丙组参赛教师的得分及获奖等次，现予以公示。 公示时间为：2019年10月15日至2019年10月17日（3个工作日）。公示期间，如有异议，请以书面形式向省教育厅体卫艺处实名反映，并提供佐证资料，以便联系核实。','已发布'),(7,'2019-10-01','安徽省第五届普通高等学校体育教师教学技能比赛于2019年9月20日至9月22日在安徽师范大学举行。\n经专家评审、现场公布参赛教师成绩、参赛老师现场签字确认等环节，已评选出甲组、公示期间，\n如有异议，请以书面形式向省教育厅体卫艺处实名反映，并提供佐证资料，以便联系核实。','已发布'),(8,'2019-10-30','安徽省第五届普通高等学校体育教师教学技能比赛于2019年9月20日至9月22日在安徽师范大学举行。\n经专家评审、现场公布参赛教师成绩、参赛老师现场签字确认等环节，已评选出甲组、乙组、丙组参赛教师的得分及获奖等次，现予以公示。 \n公示时间为：2019年10月15日至2019年10月17日（3个工作日）。\n公示期间，如有异议，请以书面形式向省教育厅体卫艺处实名反映，并提供佐证资料，以便联系核实。','待发布');
